import api from '../../services/api';    


export default class extends Component {
    state = {
        products: []
    };

    componentDidMount(){
        this.loadProducts();
    }

    loadProducts = async () => {
        const response = await api.get('/products');

        this.setState( {products: response.data.docs});
    }

    render() {
        return <h1>hello</h1>
    }
}
